webpackJsonp([0xa5811ae4e8f8],{1874:function(A,e){A.exports={data:{markdownRemark:{html:'<p>The mother-to-be needs to prepare a lot of things, not only her psychological but also many needed items. So, I\'m gonna list some things that were prepared during my pregnancy as I find them quite necessary.</p>\n<h2 id="maternity-clothes"><a href="#maternity-clothes" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Maternity clothes</h2>\n<p>From the second month of pregnancy, I packed and stored all my skinny clothes and jeans. You choose the comfortable clothes for daily wearing. There are a lot of jeans, T-shirts for pregnant women, not only comfortable but also pretty. Of course, when shopping you should consider spending economically because you can only wear them when you are pregnant.</p>\n<h3 id="span-stylecolorgreen-feeding-bra--breast-pad-span"><a href="#span-stylecolorgreen-feeding-bra--breast-pad-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:green"> Feeding bra + breast pad </span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/feedingbra-b4003ef78c8947fabcd5b93dd3769da0-0c1a3.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 107px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100.93457943925235%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="feedingbra" title="" src="/static/feedingbra-b4003ef78c8947fabcd5b93dd3769da0-0c1a3.png" srcset="/static/feedingbra-b4003ef78c8947fabcd5b93dd3769da0-0c1a3.png 107w" sizes="(max-width: 107px) 100vw, 107px">\n    </span>\n  </span>\n  \n  </a>\n     As soon as the placenta is released from the uterus, hormone levels surge so that the body begins to increase the volume of milk. In a few first months after birth, you will experience fullness in your breasts that can only be relieved by frequent breastfeeding.</p>\n<figure style="width: 200px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/aa-983e4efe90438b80f1f55359cb344c36-a490f.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 63.171355498721226%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="aa" title="" src="/static/aa-983e4efe90438b80f1f55359cb344c36-abe1c.png" srcset="/static/aa-983e4efe90438b80f1f55359cb344c36-10046.png 300w,\n/static/aa-983e4efe90438b80f1f55359cb344c36-3c4a3.png 600w,\n/static/aa-983e4efe90438b80f1f55359cb344c36-abe1c.png 1200w,\n/static/aa-983e4efe90438b80f1f55359cb344c36-1c9b7.png 1800w,\n/static/aa-983e4efe90438b80f1f55359cb344c36-a490f.png 2346w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>So, buying feeding bras and breast pads is very necessary. It is very convenient when you breastfeed, while also helping to support lifting your breast (you don\'t  want to have saggy breasts, do you?  ðŸ˜†)</p>\n<h3 id="span-stylecolororange-taÌƒ-cho-meÌ£-span"><a href="#span-stylecolororange-ta%CC%83-cho-me%CC%A3-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:orange"> TaÌƒ cho meÌ£ </span></h3>\n<p>This is a very important item that you must have! After birthing, vaginal discharge - known as lochia - is a common side effect that every mom will have. therefore, you should be prepared to bring before going to the hospital for delivery.</p>\n<h2 id="necessary-stuff"><a href="#necessary-stuff" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Necessary stuff</h2>\n<h3 id="span-stylecolordodgerblue-bottle-warmer-span"><a href="#span-stylecolordodgerblue-bottle-warmer-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:dodgerblue"> Bottle warmer </span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/avent-c0c16509990288b0f18d22f40060e4b0-eaeb6.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="avent" title="" src="/static/avent-c0c16509990288b0f18d22f40060e4b0-eaeb6.png" srcset="/static/avent-c0c16509990288b0f18d22f40060e4b0-155c1.png 300w,\n/static/avent-c0c16509990288b0f18d22f40060e4b0-eaeb6.png 500w" sizes="(max-width: 500px) 100vw, 500px">\n    </span>\n  </span>\n  \n  </a>\n    This machine helps to warm up the bottle before feeding your baby. I don\'t have much time so I often prepare milk bottle for my son, store in the refrigerate and then use this machine to warm up before I feed him. I purchased a Philips Avent bottle warmer, along with warm milk mode, there is also a food warmer mode, so convenient. But if you are not busy and think it\'s not that convenient, then don\'t buy it.</p>\n<h3 id="span-stylecolorindigo-breast-pump-span"><a href="#span-stylecolorindigo-breast-pump-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:indigo"> Breast pump </span></h3>\n<p>As mentioned above, I don\'t have time, so I use this machine to suck milk, store in the refrigerator and warm up before feeding my baby. There are many types of machines, I have used Medela Swing maxi double electric breast pump and I think it\'s good.</p>\n<figure style="width: 300px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/medela-a45627ee475a97d987bf9fdd7d710bb9-d4de1.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 459px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 64.05228758169935%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="medela" title="" src="/static/medela-a45627ee475a97d987bf9fdd7d710bb9-d4de1.png" srcset="/static/medela-a45627ee475a97d987bf9fdd7d710bb9-9f0ca.png 300w,\n/static/medela-a45627ee475a97d987bf9fdd7d710bb9-d4de1.png 459w" sizes="(max-width: 459px) 100vw, 459px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>I prefer to use the one with electrical appliances (or batteries) than pump by hand, which will save my time and energy.</p>\n<h3 id="span-stylecolorseagreen--bottle-sterilizer-span"><a href="#span-stylecolorseagreen--bottle-sterilizer-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:seagreen">  Bottle sterilizer </span></h3>\n<figure style="width: 300px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/avent1-2e095bd5f9dacf8041b5926b13d662ad-6a7bd.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 450px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="avent1" title="" src="/static/avent1-2e095bd5f9dacf8041b5926b13d662ad-6a7bd.png" srcset="/static/avent1-2e095bd5f9dacf8041b5926b13d662ad-98671.png 300w,\n/static/avent1-2e095bd5f9dacf8041b5926b13d662ad-6a7bd.png 450w" sizes="(max-width: 450px) 100vw, 450px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>In the past, they used to sink the bottle in boiled water it to sterilize but I think it takes too much time so buy this machine. All you need to do is just wash the bottles and press the sterilize button, done. I use Philips Avent 3-in-1 Electric Steam Sterilizer - this machine is sterilized by steam. The only unsatisfied thing is that after the sterilization, the bottles are still wet because of the steam. UV sterilizers make the bottles drier, but I don\'t know whether the UV rays will affect the plastic quality of the bottle or not.</p>\n<h3 id="span-stylecolorcrimson-bottle-and-pacifier-span"><a href="#span-stylecolorcrimson-bottle-and-pacifier-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:crimson"> Bottle and pacifier </span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/bottle-7be40ee9ed50cf92e87d4b1c8178951e-7cb04.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 240px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="bottle" title="" src="/static/bottle-7be40ee9ed50cf92e87d4b1c8178951e-7cb04.png" srcset="/static/bottle-7be40ee9ed50cf92e87d4b1c8178951e-7cb04.png 240w" sizes="(max-width: 240px) 100vw, 240px">\n    </span>\n  </span>\n  \n  </a>\n     Currently, there are many baby brands such as Avent, Upis, Double Heart, Spectra... Different brands have different bottle types and pacifiers. I have used the set bottle of Double Heart and found them quite good. There are 2 sizes of bottles: 160ml and 240ml with different pacifiers size SS (newborn), S (1-3 months), M (3-6 months) and L (above 6 months ).</p>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/numvu-d740c4d5c861fcf5b278c81e7851b7f5-f1dcd.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 655px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 88.3969465648855%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="numvu" title="" src="/static/numvu-d740c4d5c861fcf5b278c81e7851b7f5-f1dcd.png" srcset="/static/numvu-d740c4d5c861fcf5b278c81e7851b7f5-45777.png 300w,\n/static/numvu-d740c4d5c861fcf5b278c81e7851b7f5-3ae47.png 600w,\n/static/numvu-d740c4d5c861fcf5b278c81e7851b7f5-f1dcd.png 655w" sizes="(max-width: 655px) 100vw, 655px">\n    </span>\n  </span>\n  \n  </a>\n     The Double Heart pacifiers are soft and flexible, suitable for even newborn babies. Later on, I switched to Spectra\'s but it\'s harder and my son didn\'t like it so I had to switch again. By now I still use Double Heart. When my baby was small, I used the 160ml bottle (I bought 2 bottles). In the following months, the uptake milk volume increased, so I used 240ml bottle (4 bottles)</p>\n<h3 id="span-stylecolorteal-bottle-cleaning-foam-span"><a href="#span-stylecolorteal-bottle-cleaning-foam-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:teal"> Bottle cleaning foam </span></h3>\n<p>\n  <a class="gatsby-resp-image-link" href="/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-bb4b3.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 158.84086444007858%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="a1" title="" src="/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-abe1c.png" srcset="/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-10046.png 300w,\n/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-3c4a3.png 600w,\n/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-abe1c.png 1200w,\n/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-1c9b7.png 1800w,\n/static/a1-b4cf866cc43044b0fc6a951fc7a60d94-bb4b3.png 2036w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n     I was introduced to the cleaning foam of BnB and Double Heart. I also bought a set of bottles cleaning foam + washing kit of Double Heart. But I think whichever brand is okay.</p>\n<h3 id="span-stylecolornavy-milk-storage-bag-span"><a href="#span-stylecolornavy-milk-storage-bag-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:navy"> Milk storage bag </span></h3>\n<figure style="width: 200px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/milkbag-c4dd8bdb573d3ddfdf9def216707a52f-79c0e.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1000px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="milkbag" title="" src="/static/milkbag-c4dd8bdb573d3ddfdf9def216707a52f-79c0e.png" srcset="/static/milkbag-c4dd8bdb573d3ddfdf9def216707a52f-a085f.png 300w,\n/static/milkbag-c4dd8bdb573d3ddfdf9def216707a52f-4a5b3.png 600w,\n/static/milkbag-c4dd8bdb573d3ddfdf9def216707a52f-79c0e.png 1000w" sizes="(max-width: 1000px) 100vw, 1000px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Those who suck milk and store in the freezer should buy milk storage bag for storage and preservation. There are a few trusted brands to choose, and I like the Philips Avent.</p>\n<h3 id="span-stylecolorperu-thermometer-span"><a href="#span-stylecolorperu-thermometer-span" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a><span style="color:peru"> Thermometer </span></h3>\n<p>This is also one of the necessary things to buy. Regular check your baby\'s temperature is important, especially for the newborns and for those who just have the vaccination. </p>\n<figure style="width: 300px" class="align-center">\n  \n  <a class="gatsby-resp-image-link" href="/static/a8-3ff83a657bb11e75e6ad4b4a91d4e172-47f4f.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 1200px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 94.8870392390012%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="a8" title="" src="/static/a8-3ff83a657bb11e75e6ad4b4a91d4e172-abe1c.png" srcset="/static/a8-3ff83a657bb11e75e6ad4b4a91d4e172-10046.png 300w,\n/static/a8-3ff83a657bb11e75e6ad4b4a91d4e172-3c4a3.png 600w,\n/static/a8-3ff83a657bb11e75e6ad4b4a91d4e172-abe1c.png 1200w,\n/static/a8-3ff83a657bb11e75e6ad4b4a91d4e172-47f4f.png 1682w" sizes="(max-width: 1200px) 100vw, 1200px">\n    </span>\n  </span>\n  \n  </a>\n    \n  <figcaption></figcaption>\n</figure>\n<p>Because after vaccination, their temperature tend to increase that they may have a fever. For babies, having a fever is always dangerous. I bought Braun\'s thermometer and it can be used for both babies and adults.</p>',timeToRead:5,excerpt:"The mother-to-be needs to prepare a lot of things, not only her psychological but also many needed items. So, I'm gonna list some thingsâ€¦",frontmatter:{title:"Pregnancy checklist - Part 1",cover:"/images/chuanbimangthai1.png",date:"2017/12/17",category:"Baby",tags:["Baby","pregnancy-chekclist","bottle-warmer","sterilizer","thermometer","mang-thai","me-bau","vat-dung-can-thiet"]
},fields:{slug:"/en/Pregnancy-checklist-Part-1/"}}},pathContext:{path:"/en/Pregnancy-checklist-Part-1/",langKey:"en"}}}});
